import React from 'react';

const TrustedBy = () => {
  return (
    <section className="bg-gray-100 py-8">
      <div className="container mx-auto px-6 text-center">
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">Trusted By</h2>
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
          <img src="/assets/images/logo1.png" alt="Company 1" className="h-12 mx-auto" />
          <img src="/assets/images/logo2.png" alt="Company 2" className="h-12 mx-auto" />
          <img src="/assets/images/logo3.png" alt="Company 3" className="h-12 mx-auto" />
          <img src="/assets/images/logo4.png" alt="Company 4" className="h-12 mx-auto" />
        </div>
      </div>
    </section>
  );
};

export default TrustedBy;
